  return (
    <div className="new-expense">
      <p />

      <div class="ui segment ">
        <div
          class="ui two column very relaxed grid"
          style={{
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div class="column">
            <SearchTrainForm></SearchTrainForm>
          </div>
          <div class="column">

            <PnrSearch></PnrSearch>
          </div>
        </div>
        <div class="ui vertical divider"></div>
      </div>
    </div>
  );
};

export default NewSearchTrain;
